  input: 'TEXT,F3XA,,"We are in receipt of your letter regarding our July Quarterly
    Report and wish to thank you for bringing these items to our attention. After
    careful examination of our records and discussions with our CPA firm, we realized
    that we inadvertently marked the wrong election box for the following disbursements:
    2001 July 31 Mid-Year Report: Lindsey Graham for Senate Campaign, disbursement
    date - 5/15/2001 should have marked primary, not general. Once the correction
    has been made on the above report, the disbursement made on May 30, 2002 for Lindsey
    Graham in the amount of $5,000 for his general election, will not exceed the limits
    for the general election. 2002 2nd Quarter Report - Michael Burgess for Congress,
    disbursement date 4/18/2002 should have marked general not primary and John Cornyn
    for Senate, Inc. disbursement date 4/5/2002 should have marked general not primary.
    The contributions to the above candidates were designated to the correct election
    and are reflected as such on the reports that they are required to file. We have
    implemented a new check-and-balance procedure so that these errors will not occur
    in the future. Our CPA firm has been made aware of the errors and an amended report
    will be filed for the two reporting periods stated above. Please accept our apologies
    for the oversight on our part. If you have questions, please call me."'
